const Service = () => {
  return (
    <>
      <Hero
        title="ما برنامه نویسیم ولی نه فقط برنامه نویس"
        subtitle="ما کلی کارها میتونیم واست انجام بدیم که حتی فکرشم نمیتونی بکنی!"
      />
    </>
  );
};

export default Service;
